import React from "react";
import { Link } from "react-router-dom";
import NavContainer from "../../styles/Nav/Nav.styled";

const Nav = () => {
  return (
    <>
      <NavContainer>
        <div className="logo"></div>
        <div className="menu-items">
          <ul>
            <li>
              {/* <Link to={"localhost:3001/expenses"}>Expenses</Link> */}
            </li>
          </ul>
        </div>
      </NavContainer>
    </>
  );
};

export default Nav;
